import Agenda from "./agenda/Agenda";
import Follow from "./who-to-follow/Follow";

function Feed() {
  return (
    <div style={{ flex: 1 }}>
      <input
        type="search"
        name="search"
        id="search"
        placeholder="Search Twitter"
      />
      <Agenda />
      <Follow />
    </div>
  );
}

export default Feed;
